import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  btn_primary: {
    width: "100%",
    backgroundColor: "#3484fa",
    borderRadius: 3,
    height: 60,
    justifyContent: "center",
    alignItems: "center",
    marginTop: 10,
  },
  btn_outline_primary: {
    width: "100%",
    backgroundColor: "#FFF",
    borderRadius: 3,
    borderColor: "#3484fa",
    borderWidth: 1,
    height: 60,
    justifyContent: "center",
    alignItems: "center",
    marginTop: 10,
  },
});
export default styles;
